@taylorswift told Rolling Stone she wants to learn more about politics—and that’s great! 🇺🇸 According to a recent survey, most Americans would fail a basic citizenship test 😳

With civic literacy at a crisis point, we need more celebrities encouraging young people to learn 💡

Sadly, Taylor’s recent statements suggest she’s only getting a very one-sided education. Tap our stories to see what she’s missing. 🔎

President Trump just announced new programs, ideas, and goals for Second Chance Hiring—bringing awareness to the challenges felons have re-entering society and finding employment.

Though most Hollywood celebrities have bitterly spurned this administration, @kimkardashian ignored criticism and came to show support and share insights about the importance of giving a path to those who have paid their debt to society.

@heritagefoundation expert John Malcolm attended the event and remarked that he is “glad that the issue of criminal justice reform continues to move forward.”

Double tap if you think Rep. Omar needs a serious U.S. history lesson.

@ilhanmn has made headlines numerous times since taking office—most often for her offensive, anti-Semitic remarks—but now the freshman congresswoman is being called out for inaccurate statements on U.S. history and foreign policy.

When a speech she made at @cair_national drew the attention of her freshman colleague @dancrenshawtx this week, she lashed out—claiming that his tweet quoting one of her remarks was "dangerous incitement." But history shows that when false claims go unchecked, they continue to spread. Historian Jarrett Stepman has repeatedly debunked the left's claim that America was “founded by genocide” – tap our stories to learn the truth.
